      {showFirstPage ? <FirstPage setMainTags={setMainTags} changePage={changePages} mainInput={mainInput} setMainInput={setMainInput} /> : null}
      {showSecondPage ? <SecondPage tags setMainInput={setMainInput} mainInput={mainInput} changePage={changePages} /> : null}
